import React from 'react';
import Title from '../Title/Title';
import Subscribe from '../Subscribe/Subscribe';
import Footer from '../Footer/Footer';


class Men extends React.Component {
	state = {
		products: []
	}
	render() {
		return (
			<React.Fragment>
				<div>Men</div>
				<br/>
		        <Subscribe />
		        <Footer />
      		</React.Fragment>

		)
	}
}

export default Men;
